(4, 'd917a87b-223f-4b2b-aed3-557bdf500898', 6, 'FathSchool', 'fathschool', 'Welcome to FathSchool, an innovative and dynamic school website application designed to revolutionize the educational experience. FathSchool seamlessly integrates cutting-edge technology with a user-friendly interface, creating a virtual hub that fosters effective communication, collaboration, and engagement between students, parents, teachers, and administrators. Our platform offers a comprehensive suite of features, including real-time grade tracking, assignment submission and feedback, attendance monitoring, and a robust messaging system to facilitate open communication. FathSchool goes beyond traditional boundaries by incorporating interactive virtual classrooms, enabling educators to conduct live lessons, share resources, and encourage student participation. With a focus on personalization, FathSchool empowers educators to tailor their teaching methods to individual student needs, fostering a more inclusive and effective learning environment. Parents can stay actively involved in their child\'s education through personalized dashboards, event notifications, and direct communication channels with teachers. Administrators benefit from streamlined administrative processes, data analytics, and the ability to make informed decisions to enhance overall school efficiency. FathSchool is not just a platform; it\'s a transformative tool that redefines the educational landscape, promoting collaboration, accessibility, and student success.', NULL, '{\"media_token\": \"e8b102b3-dfcf-4c59-9340-6f939f50ac18\"}', '2024-02-15 15:47:32', '2024-02-15 15:47:32'),
(5, '5278b9be-5a74-423c-8a4b-c38e626c0d94', 6, 'FathERP', 'fatherp', 'FathERP, the pinnacle of comprehensive business management solutions encapsulated in a cutting-edge web application. FathERP stands as a revolutionary platform, offering an all-encompassing suite of tools designed to streamline and elevate every facet of company operations. From efficient inventory management, seamless order processing, and integrated financial tracking to advanced human resource management and analytics, FathERP empowers organizations with the tools they need to thrive in today\'s competitive business landscape. The platform\'s user-friendly interface ensures that businesses of all sizes can harness the power of enterprise resource planning without the need for extensive training. FathERP not only facilitates internal efficiency but also provides real-time insights through its robust reporting and analytics features, enabling informed decision-making at every level. With modules dedicated to project management, customer relationship management (CRM), and supply chain optimization, FathERP is a versatile solution that adapts to the unique needs of diverse industries. By fostering connectivity and collaboration within an organization, FathERP redefines how businesses operate, ensuring scalability, adaptability, and sustained success in an ever-evolving marketplace. Join the future of enterprise management with FathERP and experience a new era of productivity, innovation, and business excellence.', NULL, '{\"media_token\": \"6758b6d0-c266-4a25-9cdc-bbd092a0888c\"}', '2024-02-15 15:50:14', '2024-02-15 15:50:14'),
(6, '1d41254f-277f-459e-984b-a28c072a2de6', 5, 'Fathstore', 'fathstore', 'FathStore, the premier online marketplace for digital asset transactions at https://fathstore.com. FathStore represents a cutting-edge platform that seamlessly connects buyers and sellers in the vibrant digital asset marketplace. With a sleek and intuitive interface, users can explore a diverse range of digital assets, including graphics, templates, audio files, and more, all meticulously curated to meet the ever-evolving needs of creators, businesses, and enthusiasts alike. FathStore goes beyond conventional e-commerce platforms by providing a secure and transparent environment, leveraging blockchain technology to ensure the authenticity and provenance of digital assets. Sellers can easily showcase their creations, set prices, and reach a global audience, while buyers enjoy a hassle-free purchasing experience with instant downloads and secure payment options. FathStore also incorporates a robust review and rating system, fostering a community-driven approach to quality assurance. Whether you\'re a digital artist looking to monetize your talents or a business seeking premium digital assets, FathStore is your go-to destination, offering a seamless and reliable marketplace for all your digital asset needs. Join FathStore today and embark on a journey of discovering, buying, and selling digital creativity like never before.', NULL, '{\"media_token\": \"35b86715-e536-4143-974f-72e946d8b0aa\"}', '2024-02-15 15:51:33', '2024-02-15 15:51:33'),
(7, '0a2ddd4d-f7e9-4d82-979c-515084fd71e8', 6, 'FathCoop', 'fathcoop', 'FathCoop, a revolutionary web application designed to streamline and enhance cooperative management. FathCoop is a comprehensive platform that caters to the diverse needs of cooperative societies, offering an array of features to simplify and optimize their operations. With a user-friendly interface, the application provides a centralized hub for members, administrators, and stakeholders to collaborate efficiently. FathCoop facilitates transparent financial management through its integrated accounting system, allowing for seamless tracking of transactions, expenditures, and profits. Cooperative members can access real-time updates on their financial contributions, dividends, and overall account status. The application also promotes effective communication by offering a secure messaging system and announcement features to keep all stakeholders informed about important events and decisions. FathCoop takes cooperative management to the next level by automating routine tasks such as member registrations, loan approvals, and document submissions, thereby reducing administrative burdens. Additionally, the platform prioritizes data security, ensuring that sensitive cooperative information remains confidential and protected. FathCoop is not just a tool; it\'s a catalyst for cooperative growth, fostering efficiency, transparency, and collaboration within the cooperative community. Embrace the future of cooperative management with FathCoop by visiting https://coop.fath.my.id.', 'https://fathcoop.com/', '{\"media_token\": \"769854ed-4986-4814-850c-5c72ad87142b\"}', '2024-02-15 15:52:44', '2024-05-21 20:52:02');

